/*
Given a square grid of integers arr, a falling path with non-zero shifts is a choice of exactly one element from each row of arr, such that no two elements chosen in adjacent rows are in the same column.

Return the minimum sum of a falling path with non-zero shifts.

 

Example 1:

Input: arr = [[1,2,3],[4,5,6],[7,8,9]]
Output: 13
Explanation: 
The possible falling paths are:
[1,5,9], [1,5,7], [1,6,7], [1,6,8],
[2,4,8], [2,4,9], [2,6,7], [2,6,8],
[3,4,8], [3,4,9], [3,5,7], [3,5,9]
The falling path with the smallest sum is [1,5,7], so the answer is 13.
 

Constraints:

1 <= arr.length == arr[i].length <= 200
-99 <= arr[i][j] <= 99
*/

// naive O(n^3)
var minFallingPathSum = function (arr) {
  for (let i = 1; i < arr.length; i += 1) {
    for (let j = 0; j < arr.length; j += 1) {
      arr[i][j] += arr[i - 1].reduce((min, val, idx) =>
        idx === j ? min : Math.min(min, val),
        Number.MAX_SAFE_INTEGER,
      );
    }
  }

  return arr[arr.length-1].reduce((min, val) => Math.min(min, val), Number.MAX_SAFE_INTEGER);
};

// O(n^2) - could probably write clenaer
var minFallingPathSum = function (arr) {
  const len = arr.length;

  if (len === 1) return arr[0][0];
  let prevSmallest = arr[0][0] < arr[0][1] ? 0 : 1;
  let prevNextSmallest = prevSmallest === 1 ? 0 : 1;

  for (let j = 2; j < len; j += 1) {
    if (arr[0][j] < arr[0][prevSmallest]) {
      prevNextSmallest = prevSmallest;
      prevSmallest = j;
    } else if (arr[0][j] < arr[0][prevNextSmallest]) {
      prevNextSmallest = j;
    }
  }

  for (let i = 1; i < len; i += 1) {
    let smallest = -1;
    let nextSmallest = -1;

    for (let j = 0; j < len; j += 1) {
      if (j === prevSmallest) {
        arr[i][j] += arr[i - 1][prevNextSmallest];
      } else if (j === prevNextSmallest) {
        arr[i][j] += arr[i - 1][prevSmallest];
      } else {
        arr[i][j] += Math.min(arr[i - 1][prevSmallest], arr[i - 1][prevNextSmallest]);
      }

      if (smallest < 0 || arr[i][j] < arr[i][smallest]) {
        nextSmallest = smallest;
        smallest = j;
      } else if (nextSmallest < 0 || arr[i][j] < arr[i][nextSmallest]) {
        nextSmallest = j;
      }
    }

    prevSmallest = smallest;
    prevNextSmallest = nextSmallest;
  }

  return arr[len - 1][prevSmallest];
};


